    false,nt"url": null,nt"notes": "The Necedah National Wildlife Refuge is
    located in a rural environment approximately 150 miles northwest of Milwaukee, 100
    miles northwest of Madison, and 150 miles southeast of Minneapolis, the nearest
    metropolitan areas. It is surrounded within 30 miles by the towns of Tomah, Mauston,
    and Wisconsin Rapids. Search and rescue activities are primarily those associated
    with the deer hunting season. During other times of the year, visitation is usually
    light and travel off township roads is prohibited. About one third of the refuge
    is open to deer hunting during the early bow season and the entire refuge is open
    during the gun deer and late bow seasons. The highest hunter population occurs during
    the opening day of the gun season when over two thousand hunters are on the refuge
    at one time.",nt"license_title": "License Not Specified",nt"extras":
